var fileJSON=[{"path":"/home/joerock/Documents/TFM/Quartus_Sim-Em/SR_relax_data_dependency/float4_SR.cl", "name":"float4_SR.cl", "has_active_debug_locs":false, "absName":"/home/joerock/Documents/TFM/Quartus_Sim-Em/SR_relax_data_dependency/float4_SR.cl", "content":"//1x1 convolution layer as a single kernel\012//output one feature map per kernel\012#define II_CYCLES 16\012\012__kernel void conv2d1x1(\012	const int input_channels, \012    const int input_size,\012    const int filter_size,\012	__global float * restrict input_im,\012	__global const float4* restrict filter_weight,\012	__global const float* restrict filter_bias,\012	__global float *restrict output_im)\012{\012	// Adding restrict keyword\012	\012	float shift_reg[II_CYCLES + 1];\012	for(int i = 0; i < (II_CYCLES + 1); i++)\012	{\012		shift_reg[i] = 0;\012	}\012		\012    //loop over filters\012	for(int f_i = 0; f_i < filter_size; f_i++)\012	{\012        //filter_weight += f_i * input_channels;\012\012        float bias = filter_bias[f_i];\012	\012        // output_im += input_size * input_size;//start_channel is for 1x1 feature map in fire layer\012	\012		for(int ij = 0; ij < (input_size * input_size); ij++)\012		{\012			// int loc = i * input_size + j; // this is equal to ij\012\012			for(int k = 0; k < input_channels; k++)\012			{\012				//float8 weight = filter_weight[k];\012				//float8 feature;\012				shift_reg[II_CYCLES] = shift_reg[0] + input_im[((k << 2) + 0) * input_size * input_size + ij] * filter_weight[k + f_i * input_channels].s0;\012				shift_reg[II_CYCLES - 1] = input_im[((k << 2) + 1) * input_size * input_size + ij] * filter_weight[k + f_i * input_channels].s1;\012				shift_reg[II_CYCLES - 2] = input_im[((k << 2) + 2) * input_size * input_size + ij] * filter_weight[k + f_i * input_channels].s2;\012				shift_reg[II_CYCLES - 3] = input_im[((k << 2) + 3) * input_size * input_size + ij] * filter_weight[k + f_i * input_channels].s3;\012				\012				#pragma unroll\012				for(int j = 0; j < II_CYCLES; j++)\012				{\012					shift_reg [j] = shift_reg[j + 1];\012				}\012				     /*+ input_im[((k << 2) + 1) * input_size * input_size + ij] * filter_weight[k + f_i * input_channels].s1\012					 + input_im[((k << 2) + 2) * input_size * input_size + ij] * filter_weight[k + f_i * input_channels].s2\012					 + input_im[((k << 2) + 3) * input_size * input_size + ij] * filter_weight[k + f_i * input_channels].s3;*/\012                /*tmp += input_im[((k << 2) + 0) * input_size * input_size + ij] * filter_weight[k].s0\012				     + input_im[((k << 2) + 1) * input_size * input_size + ij] * filter_weight[k].s1\012					 + input_im[((k << 2) + 2) * input_size * input_size + ij] * filter_weight[k].s2\012					 + input_im[((k << 2) + 3) * input_size * input_size + ij] * filter_weight[k].s3;*/\012			}\012			//add relu after conv\012			float tmp = bias;\012			\012			#pragma unroll\012			for(int i = 0; i < II_CYCLES; i++)\012			{\012				tmp += shift_reg[i];\012			}\012			\012			output_im[ij + (input_size * input_size * f_i)] = (tmp > 0.0) ? tmp : 0.0;\012            //output_im[ij] = (tmp > 0.0) ? tmp : 0.0;\012		}\012        //filter_weight += input_channels;	\012        //output_im += input_size * input_size;//start_channel is for 1x1 feature map in fire layer\012	\012	}\012}\012"}];
